import React from "react";
import BuildControl from "../BuildControl";
import css from "./style.module.css";

const BuildControls = (props) => (
  <div className={css.BuildControls}>
    <BuildControl
      ortsHasah={() => props.ortsHasah("salad")}
      ortsNemeh={props.ortsNemeh}
      type="salad"
      orts="Salad"
    />
    <BuildControl
      ortsHasah={() => props.ortsHasah("bacon")}
      ortsNemeh={props.ortsNemeh}
      type="becon"
      orts="gahain mah"
    />
    <BuildControl
      ortsHasah={() => props.ortsHasah("chesse")}
      ortsNemeh={props.ortsNemeh}
      type="chesse"
      orts="Byaslaga"
    />
    <BuildControl
      ortsHasah={() => props.ortsHasah("meat")}
      ortsNemeh={props.ortsNemeh}
      type="meat"
      orts="Mah"
    />
    {/* <BuildControls ortsHasah={props.ortsHasah} type="salad" orts="salad" />
    <BuildControls ortsHasah={props.ortsHasah} type="bacon" orts="Bacon meat" />
    <BuildControls ortsHasah={props.ortsHasah} type="chesse" orts="Chesse" />
    <BuildControls ortsHasah={props.ortsHasah} type="meat" orts="Meat" /> */}
  </div>
);

export default BuildControls;
